import React from "react";
import {View, Text, StyleSheet, FlatList, Pressable} from "react-native";
const DATA = [
  {
    title: "First Item",
    age: "44",
  },
  {
    title: "Second Item",
    age: "31",
  },
  {
    title: "Third Item",
    age: "20",
  },
];

const ListScreen = () => {
  const onPressFunction = () => {
    console.log("pressed");
  };
  return (
    <View>
      <Text style={styleText.headerStyle}>List Screen</Text>
      <FlatList
        keyExtractor={(DATA) => DATA.title}
        data={DATA}
        renderItem={({item, index}) => {
          return (
            <Text style={styleText.listStyle}>
              {item.title} {item.age}
            </Text>
          );
        }}
      />
    </View>
  );
};
const styleText = StyleSheet.create({
  headerStyle: {fontSize: 30, textAlign: "center", marginTop: 30},
  listStyle: {
    borderColor: "blue",
    borderWidth: 1,
    fontSize: 22,
    marginVertical: 50,
  },
});
export default ListScreen;
